ty &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"35071","type":"CustomJS"},{"attributes":{"children":[[{"id":"34727"},0,0],[{"id":"34873"},1,0],[{"id":"34687"},2,0],[{"id":"34924"},3,0],[{"id":"35015"},4,0]]},"id":"35156","type":"GridBox"},{"attributes":{"fill_color":{"value":"cyan"},"hatch_color":{"value":"cyan"},"line_color":{"value":"cyan"},"size":{"value":8},"x":{"value":3},"y":{"value":1.021544675}},"id":"34777","type":"Scatter"},{"attributes":{"coordinates":null,"group":null,"line_color":"#666666","line_dash":[6],"line_width":0.5,"location":0.0024378575834704754},"id":"35066","type":"Span"},{"attributes":{"data":{},"selected":{"id":"34818"},"selection_policy":{"id":"34817"}},"id":"34798","type":"ColumnDataSource"},{"attributes":{"source":{"id":"34720"}},"id":"34917","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.1},"hatch_color":{"value":"blue"},"line_a
